import React from 'react'
import Card from '../UI/Card'
import './UserList.css'
const UserList = (props) => {
  return (
   <Card className='users'>
     <ul>
        {props.userDetails.map
        (user=><li>
          {user.name}
          ({user.age} years Old)

        </li>)}
        </ul>
   </Card>
  )
}

export default UserList
